import{_ as e,c as t,o as a,d as r}from"./app.174a6592.js";const m=JSON.parse('{"title":"Income Tax belated return filing due date","description":"","frontmatter":{},"headers":[{"level":2,"title":"Consequence of late","slug":"consequence-of-late"},{"level":2,"title":"AY 2022-23","slug":"ay-2022-23"}],"relativePath":"income-tax/belated-return.md","lastUpdated":1659936540000}'),n={name:"income-tax/belated-return.md"},i=r('<h1 id="income-tax-belated-return-filing-due-date" tabindex="-1">Income Tax belated return filing due date <a class="header-anchor" href="#income-tax-belated-return-filing-due-date" aria-hidden="true">#</a></h1><p>When a income tax return is not filed within <a href="./return-filing.html">due date</a>, it can still be filed as &quot;belated return&quot;. Section 139(4) allows for the filing of a belated return i.e return after the due date.</p><p>The general due date for filing belated return 31st December of the assessment year.</p><blockquote><p>A belated return can be filed for a previous year at any time three months before the expiry of the relevant assessment year, or before completion of assessment, whichever is earlier.</p></blockquote><p>Unlike <a href="./return-filing.html">due date for return filing</a>, due date for belated return is not dependent on Category of Tax payer.</p><h2 id="consequence-of-late" tabindex="-1">Consequence of late <a class="header-anchor" href="#consequence-of-late" aria-hidden="true">#</a></h2><p>Taxpayers cannot file any return once this due date is passed. However, if the return was missed due to an extreme situation, you can lodge a request to your Assessment Officer seeking permission to file past returns under Section 119.</p><h2 id="ay-2022-23" tabindex="-1">AY 2022-23 <a class="header-anchor" href="#ay-2022-23" aria-hidden="true">#</a></h2><p>The due date for filing belated return for AY 2022-23 is 31st December 2022.</p>',9),o=[i];function s(d,l,u,c,f,h){return a(),t("div",null,o)}var _=e(n,[["render",s]])